import{_ as e,o as n,c as t,O as r}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 18.2-246.2 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-246.2.md","filePath":"vacode/18.2-246.2.md"}'),o={name:"vacode/18.2-246.2.md"},i=r('<h1 id="§-18-2-246-2-definitions" tabindex="-1">§ 18.2-246.2 Definitions. <a class="header-anchor" href="#§-18-2-246-2-definitions" aria-label="Permalink to &quot;§ 18.2-246.2 Definitions.&quot;">​</a></h1><p>&quot;Conduct&quot; or &quot;conducts&quot; includes initiating, concluding, participating in, or assisting in a financial transaction.</p><p>&quot;Financial transaction&quot; means any purchase, sale, trade, loan, pledge, investment, gift, transfer, transmission, transportation, delivery, deposit, withdrawal, payment, transfer between accounts, exchange of currency, extension of credit, purchase or sale of monetary instruments, use of a safe-deposit box, or any other acquisition or disposition of monetary instruments by any means including the movement of funds by wire or other electronic means, which is knowingly designed in whole or in part to conceal or disguise the nature, location, source, ownership or control of the property involved in the transaction.</p><p>&quot;Monetary instruments&quot; means (i) coin or currency of the United States or of any other country, travelers&#39; checks, personal checks, bank checks, cashier&#39;s checks, credit cards, debit cards, and money orders or (ii) securities or other negotiable instruments, in bearer form or otherwise.</p><p>&quot;Person&quot; includes any individual, partnership, association, corporation or joint venture.</p><p>&quot;Proceeds&quot; means property acquired or derived, directly or indirectly, from, produced through, realized through, or caused by an act or omission and includes property, real or personal, of any kind.</p><p>&quot;Property&quot; means anything of value, and includes any interest therein, including any benefit, privilege, claim or right with respect to anything of value, whether real or personal, tangible or intangible.</p><p>1999, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0348" target="_blank" rel="noreferrer">348</a>; 2003, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0541" target="_blank" rel="noreferrer">541</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0549" target="_blank" rel="noreferrer">549</a>.</p>',8),a=[i];function s(c,l,d,p,u,h){return n(),t("div",null,a)}const _=e(o,[["render",s]]);export{g as __pageData,_ as default};
